import { createApp } from "vue";
import App from "./App.vue";
import { BootstrapVue, IconsPlugin } from 'bootstrap-vue'
import "bootstrap/dist/css/bootstrap.min.css";
import "@/assets/css/main.css";
import "@/assets/css/protocol.css";
import router from "./router";
// To import Bootstrap and BootstrapVue CSS files (order is important)
// import 'bootstrap/dist/css/bootstrap.css'
import 'bootstrap-vue/dist/bootstrap-vue.css'
const app = createApp(App);

// Make BootstrapVue available throughout the kadastr
Vue.use(BootstrapVue)

// Optionally install the BootstrapVue icon components plugin
Vue.use(IconsPlugin)

Vue.config.productionTip = false


// app.config.globalProperties["$BASE_URL"] = "https://kadastr.strangebit.io";
app.config.globalProperties["$BASE_URL"] = "http://localhost:5001";
app.use(router);
app.mount("#app");
